function initiateShutdown(force) {
    if (force || !this.targetMorph.scriptPane.hasChanged()) {
        $super();
    } else {
        this.targetMorph.confirmShutdown(function(answer) {
            answer && this.initiateShutdown(true);
        }.bind(this));
    }
}

